import React from "react";
import { Form, Button } from 'react-bootstrap';

import WebNav from '../component/WebNav';
import Footer from '../component/Footer';


const Login = () => {
  return (
    <>
      <WebNav />
      <LoginForm />
      <Footer />
    </>
  );
}

export default Login;
